# III. NUMERICAL ANALYSIS OF THE FORM FACTORS 

As mentioned in Sec. I, the study of the heavy baryons and their decay properties is of crucial importance in probing hadronic structures. The decay width, as an observable quantity in experiment, is a main source to achieve this purpose. In theory, the decay width is obtained by computing the responsible form factors. In our approach, form factors are determined after acquiring the QCD sum rules and analyzing the numerical results. Since the form factors are invariant functions of $q^{2}$, it is essential to analyze their behavior in terms of $q^{2}$. To this end, some input parameters are required that are itemized in Table III.

In addition, as we previously mentioned, some auxiliary parameters appear in the calculations. These are the Borel parameters $M^{2}$ and $M^{\prime 2}$, the continuum thresholds $s_{0}$ and $s_{0}^{\prime}$, and the mixing parameter $ eta$ in the interpolating currents of spin- $ rac{1}{2}$ baryons. Based on the standard requirements of the method, physical quantities are supposed to possibly show stable behavior with respect to variations of these helping parameters. This constraint in addition to other requirements, including pole dominance, at the initial and final channels, and convergence of the OPE, impose restrictions on the working domains of these parameters. In this framework, the contribution of the ground state, i.e. pole contribution, is considered to be larger than the contributions of the higher states and continuum. This consideration introduces the upper limits of the Borel parameters, $M^{2}$ and $M^{\prime 2}$ by demanding

